import React from 'react';

export const StationDetails = ({ name, elevation, temp, newSnow, snowDepth }) => {
  return (
    <div>
      <>{name}</>
      <>{elevation}</>
      <>Current Temp: {temp} {String.fromCharCode(176)}C</>
      <>New Snow Past 24hr: {newSnow} cm</>
      <>Snow Depth: {snowDepth} cm</>
    </div>
  )
}
